description:
Verenigde Staten
Drama / Romantiek
114 minuten

goed

met Anne Hathaway, Rosemarie DeWitt en Mather Zickel

Als Kym Buchman (Anne Hathaway) naar het ouderlijke huis terugkeert voor het huwelijk van haar zus, brengt ze een verleden van 
persoonlijke crisis, familieconflicten en tragedie met zich mee. De talrijke vrienden en kennissen van de bruid en bruidegom 
zijn samengekomen voor een opgewekt weekend van feesten, muziek en liefde. Kym, met haar bijtende oneliners en flair voor 
sensationeel drama, is echter een katalysator voor de sluimerende spanningen in de familiedynamiek.:
